import React from 'react';
import './Navbar.css';

const navbar = () =>{
  return(
    <div className="navbar--container">
      <nav>
        <span>PvE</span>
        <span>Fractals</span>
        <span>WvW</span>
        <span>Search</span>
      </nav>
    </div>
  );
}

export default navbar;
